import apiService from '../../services/api.service'

const IndexPage = () => {

    const oneCall = () => {
        apiService
            .getInput()
            .then(({ data }) => console.log(data))
            .catch(err => console.log(err))
    }

    return (
        <>
            <h1>Indexpage funcional</h1>
            <p>{oneCall}</p>
        </>
    )

}
export default IndexPage
